import React, { useState } from "react";
import Calendar from "react-calendar";
import "./Home.css"; // Import the updated CSS file

const Home = () => {
  const [date, setDate] = useState(new Date());

  const handleCalendarChange = (selectedDate) => {
    setDate(selectedDate);
  };

  const handleLogout = () => {
    alert("Logout button clicked!");
  };

  return (
    <div className="home-container">
      {/* Header */}
      <header className="header">
  <div className="logo-container">
    <img src="path/to/logo.png" alt="App Logo" className="logo" />
    <span className="app-name">Your Application Name</span>
  </div>
  <div className="profile-section">
    <img src="path/to/profile-image.jpg" alt="Profile" className="profile-image" />
    <div className="profile-details">
      <span className="profile-name">User Name</span>
      <span className="profile-email">user@example.com</span>
    </div>
    <button className="logout-button">Logout</button>
  </div>
</header>


      {/* Vertical Navigation Bar */}
      <nav className="vertical-nav">
        <div className="profile-section">
          <img
            src="https://via.placeholder.com/50"
            alt="Profile"
            className="profile-image"
          />
          <div className="profile-details">
            <span className="profile-name">Damini Vaidya</span>
            <span className="profile-email">damini.vaidya@ubs.com</span>
          </div>
        </div>
        <div className="nav-item">
          <input
            type="text"
            placeholder="Search meetings..."
            className="search-bar"
          />
        </div>
      </nav>

      {/* Main Content Area */}
      <div className="main-content">
        {/* Calendar Section */}
        <div className="calendar-section">
          <Calendar onChange={handleCalendarChange} value={date} />
        </div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>Â© 2024 MOMSync. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
